{"post_stream":{"posts":[{"id":3146269,"name":"Jackson Elia","username":"Traptricker","avatar_template":"/user_avatar/www.chiefdelphi.com/traptricker/{size}/215403_2.png","created_at":"2023-02-15T21:41:06.632Z","cooked":"<p>So I thought that SwerveDriveKinematics is supposed to be made in the order that you have your modules in for odometry. For my team we are doing frontLeft, frontRight, rearLeft, rearRight. When I look at our code, it doesn’t made any sense to me:</p>
<pre><code class="lang-auto">    // Distance between centers of right and left wheels on robot
    public static final double trackWidth = Units.inchesToMeters(24.5);
    // Distance between front and back wheels on robot
    public static final double wheelBase = Units.inchesToMeters(24.5);
    public static final SwerveDriveKinematics driveKinematics =
      new SwerveDriveKinematics(
        new Translation2d(wheelBase / 2, trackWidth / 2), // Front Left
        new Translation2d(wheelBase / 2, -trackWidth / 2), // Front Right
        new Translation2d(-wheelBase / 2, trackWidth / 2), // Rear Left
        new Translation2d(-wheelBase / 2, -trackWidth / 2) // Rear Right
      );
</code></pre>
<p>The Translation2ds should be the x and y coordinates of where the modules are relative to the center of the robot, right? So why does this code not work?</p>
<pre><code class="lang-auto">public static final SwerveDriveKinematics driveKinematics =
      new SwerveDriveKinematics(
        new Translation2d(-trackWidth / 2, wheelBase / 2), // Front Left
        new Translation2d(trackWidth / 2, wheelBase / 2), // Front Right
        new Translation2d(-trackWidth / 2, -wheelBase / 2), // Rear Left
        new Translation2d(trackWidth / 2, -wheelBase / 2) // Rear Right
      );
</code></pre>","post_number":1,"post_type":1,"posts_count":3,"updated_at":"2023-02-15T21:41:06.632Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":33,"reads":77,"readers_count":76,"score":180.4,"yours":false,"topic_id":426967,"topic_slug":"confusion-with-swerve-kinematics","display_username":"Jackson Elia","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":null,"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":53032,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"4829 Mentor"},"post_url":"/t/confusion-with-swerve-kinematics/426967/1","custom_user_title":"4829 Mentor","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":true,"can_vote":false},{"id":3146275,"name":"Sanjith U","username":"sanjithar","avatar_template":"/user_avatar/www.chiefdelphi.com/sanjithar/{size}/193082_2.png","created_at":"2023-02-15T21:45:49.404Z","cooked":"<p>It has to do with the robot-centric coordinate system in WPILib. The convention is that +x is out front from the robot’s perspective and +y is out left of the robot (you can verify this with the right-hand rule, +z is up so counter-clockwise rotation is positive, which checks out).</p>
